import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import '../App.css';
import LoginBtn from "./LoginBtn";

export default function LoginBox({googleSignIn, emailSignIn}){
    return(
        <>
            <section className="login-box">
                <h1>Login to your profile</h1>
                <LoginBtn type="Email" googleSignIn={googleSignIn}/>
                <LoginBtn type="Google" emailSignIn={emailSignIn}/>
            </section>
        </>
    )
}
